import React from 'react';
import styled from 'styled-components';
import Footer from '../Footer';

const FilterDiv = styled.div`
  position: absolute;
  width: 100%;
  transform: translateX(50%);

  .filter-item {
    transition: all 0.5s;
    &__name {
    }

    &__content {
      transition: all 0.5s;
      visibility: hidden;
    }
  }
`;

function Filters() {
  const handleClick = (e) => {
    console.log(e.target.parentElement);
    // const foot = <Footer />;
    const foot = `<p>kkkk</p>`;
    e.target.parentElement.insertAdjacentElement('beforebegin', foot);
    return foot;
  };
  return (
    <FilterDiv>
      <div className="filter-item" onClick={handleClick}>
        <div className="filter-item__name">cena</div>
        <div className="filter-item__content">0 zł - 9999 zł</div>
      </div>
      <div className="filter-item">
        <div className="filter-item__name">cena</div>
        <div className="filter-item__content">0 zł - 9999 zł</div>
      </div>
    </FilterDiv>
  );
}

export default Filters;
